    "2013-03-19T00:28:16.610054",nt"name": "preliminary-derivative-geologic-materials-map-of-the-fairbanks-mining-district-alaska",nt"isopen":
    false,nt"url": null,nt"notes": "This map illustrates potential near-surface
    sources of geologic materials that may be useful for construction and other purposes.
    Field observations indicate that each geologic unit (for example, flood-plain alluvium)
    has a definite composition or range of composition. Therefore, the presence of material
    type is interpreted from the distribution of geologic units (Newberry and others,
    1996 - PDF96-16). Assignment of Unified Soil Classes (Wagner, 1957) is based on
    visual observation and interpretation of the likely distribution of the materials;
    no grain-size analyses were performed. Descriptions of unconsolidated deposits are
    modified from Pewe and Bel (1975a-d) and Pewe and Bell (1976). This map is generalized
    and is not intended to show exact locations of specific materials.",nt"license_title":
